import React from "react";

const AcHeading = {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
}

export const AccordionBdy = ({props}) => {
    return (
    <>

        <div>
            <h3 style={AcHeading}>{props.Heading}<span>+</span></h3>
        </div>
        <p>{props.heading}</p>
    </>
    )
}
